import { DefaultTheme } from "./styled"

export const light: DefaultTheme = {
    mode_name: "light",

    mainBackground: `#ffffff`,
    mainBackground: `#ffffff`,
    border: "#222222",
    text: "#111111",
    title: "#000000",
    disabled: `rgba(255,255,255,0.25)`,
    primary: {
        main: "#f1a150",
        text: `#fff`,
        border: "transparent",
    },
    secondary:{
        main: "#ffdcb9",
        text: `rgba(255,255,255,0.85)`,
        border: "transparent",
    },
    ghost: {
        main: `rgba(255,255,255,0)`,
        text: '#ff9425',
        border: "#000000",
    }
}
export const dark: DefaultTheme = {
    mode_name: "dark",
    mainBackground: "#121212",
    container: "#333",
    border: "#dddddd",
    text: "#dedede",
    title: `rgba(255,255,255,0.85)`,
    disabled: `rgba(255,255,255,0.25)`,
    primary: {
        main: "#f1a150",
        text: `#fff`,
        border: "transparent",
    },
    secondary:{
        main: "#ffdcb9",
        text: `rgba(255,255,255,0.85)`,
        border: "transparent",
    },
    ghost: {
        main: `rgba(255,255,255,0)`,
        text: '#ff9425',
        border: "#000000",
    }
}
